def make_joint_figure():

    binmaps = [plt.imread(f"nb_params.png"),
               plt.imread('figure_alpha.png')]
    titles = ['a)','b)']
    fig, axs = plt.subplots(1, 2,
                            figsize=(12, 6),
                            gridspec_kw={'wspace': 0.},
                            width_ratios=(4, 3),
                            constrained_layout=False)

    for i, j in enumerate(binmaps):
        axs[i].imshow(j)
        axs[i].set_title(titles[i], loc='left', fontsize=16, fontweight='bold',
                         **{'fontname': 'Ubuntu'})
    axs[0].axis('off')
    axs[1].get_xaxis().set_visible(False)
    axs[1].get_yaxis().set_visible(False)
    plt.savefig("forecasts_npua.jpg", dpi=400, bbox_inches='tight')
    plt.savefig("fig15.jpg", dpi=1200, bbox_inches='tight')
    plt.show()



if __name__ == '__main__':
    make_alpha(5)
    make_joint_figure()